import * as React from "react"
import { Frame } from "framer"

export function DisplayPhoto(props) {
    return (
        <Frame height={"100%"} width={"100%"} background="">
            <img
                src={props.imageData}
                style={{
                    marginLeft: "50%",
                    height: "100%",
                    transform: "translateX(-50%)",
                }}
            />
        </Frame>
    )
}
